import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Index from './index.component';
class Header extends Component {
    render() {
        return (
            <Router>
                <div className="header">
                    <nav className="navbar navbar-expand-lg navbar-light">
                        <div className="collapse navbar-collapse" id="navbarSupportedContent">
                            <div className="container">
                                <img className="logo" src="https://image.freepik.com/free-vector/barbecue-grill-logo-template-premium-vector_144543-93.jpg" alt="Logo"></img>
                                <ul className="navbar-nav mr-auto">
                                    <li className="nav-item">
                                        <Link to={'#'} className="nav-link">Khuyến mãi</Link>
                                    </li>
                                    <li className="nav-item">
                                        <Link to={'#'} className="nav-link">Về chúng tôi</Link>
                                    </li>
                                    <li className="nav-item">
                                        <Link to={'#'} className="nav-link">Liên hệ</Link>
                                    </li>
                                </ul>
                            </div>
                        </div>
                    </nav>
                </div>
            </Router>
        );
    }
}

export default Header;
